<script>
import { RouterLink } from 'vue-router'
import DropDownItems from './ui/DropDownItems.vue'
import DropDownHeader from './ui/DropDownHeader.vue';
import MessageView from "./ui/MessageView.vue"
import MyConfirm from './ui/MyConfirm.vue'
import { mapGetters, mapActions, mapMutations} from "vuex"
export default {
  data() {
    return {
      isActive: true,
      searchValue:''
    }
  },
  components:{
    DropDownItems,
    MessageView,
    MyConfirm,
    DropDownHeader
  },
  computed:{
    classObject() {
      console.log(this.isActive)
      return {
        fixeds: this.isActive
      }
    }
  },
  methods: {
    ...mapActions([
      "getSearchDb",
    ]),
    setIsActive(){
      let scrollY = window.pageYOffset;
      
      if(scrollY > 1) {
        this.isActive=true;
      } else {
        this.isActive=false;
      }
    },
    async searchQuery(){
      console.log("this.searchValue - ", this.searchValue)
      
      
      await this.getSearchDb({limit:25, page:1, filter:this.searchValue})
      this.$router.push({name: 'search' })
      
    }
  }, 
  mounted() {
    window.addEventListener('scroll', () => this.setIsActive())
  }
} 

</script>


